import { createIcon } from "../icon/createIcon";

export const ArrowUpIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ArrowUpIcon">
    <path d="M5 12V4H2l4-4 4 4H7v8H5z" />
  </svg>,
  "ArrowUp",
  "arrow up"
);
